import React from 'react';
import { NavLink } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import companyLogo from './assets/book_my_party-removebg-preview.png'; // Adjust the path if needed
import './assets/css/Header.css'; // External CSS for additional styling

const Header = () => {
  return (
    <header className="header">
      <div className="container-main header-container">
        <div className="logo-container">
          {/* Company Logo */}
          <NavLink className="logo" to="/">
            <img src={companyLogo} alt="Company Logo" className="logo-img" />
          </NavLink>
        </div>
        {/* Login Button */}
        <div className="login-container">
          <NavLink className="login-button" to="/LoginForm">
            Login
          </NavLink>
        </div>
      </div>
    </header>
  );
};

export default Header;
